import React from 'react';
import Highcharts from 'highcharts/highstock'

import ChartLine from '@screens/Home/components/ChartLine';
import ChartBar from '@screens/Home/components/ChartBar';




const chartOptions = {
  title: null,
  tooltip:{
    enabled:false
  },
  series: [{
    data: [1,2,3, 10],

  }]
}

//colors: ['#2f7ed8', '#0d233a', '#8bbc21', '#910000', '#1aadce',
//'#492970', '#f28f43', '#77a1e5', '#c42525', '#a6c96a']

const chartOptionsBar = {
  chart: {
    type: 'column'
},
  title: {
    text: 'Teste'
  },
  legend: {
    enabled:false
  },
  xAxis:[{labels:{enabled:false}}],
  series: [{
    data: [
      {
          name: "Chrome",
          y: 62.74,
          drilldown: "Chrome",
          color:'#000'
      },
      {
          name: "Firefox",
          y: 10.57,
          drilldown: "Firefox"
      },
      {
          name: "Internet Explorer",
          y: 7.23,
          drilldown: "Internet Explorer"
      },
      {
          name: "Safari",
          y: 5.58,
          drilldown: "Safari"
      },
      {
          name: "Edge",
          y: 4.02,
          drilldown: "Edge"
      },
      {
          name: "Opera",
          y: 1.92,
          drilldown: "Opera"
      },
      {
          name: "Other",
          y: 7.62,
          drilldown: null
      }
  ],

  }]
}

const data = [1,2,3,4,5];


/**
 * @exports
 * @function
 * @components HomeScreen
 * @param {string} id
 * @namespace screens screens/Workflow
 *
 * @description
 * Respons치vel pela p치gina de montagem do workflow.
 */
export const ChartPage: React.FC = () => (
  <>
    <ChartLine options={chartOptions} highcharts={Highcharts}/>
    <div>
      {data.map((item)=>{
        return <ChartBar key={item} options={chartOptionsBar} highcharts={Highcharts}/>
      })}

    </div>
  </>
);
